const SourceSansPro200 = `@font-face { font-family: 'Source Sans Pro'; font-style: normal; font-weight: 200; src: local('Source Sans Pro ExtraLight'), local('SourceSansPro-ExtraLight'), url('data:font/woff2;base64,') format('woff2'); }`;
const SourceSansPro200italic = `@font-face { font-family: 'Source Sans Pro'; font-style: italic; font-weight: 200; src: local('Source Sans Pro ExtraLight Italic'), local('SourceSansPro-ExtraLightItalic'), url('data:font/woff2;base64,') format('woff2'); }`;
